Привет, коллеги!

Компания: *Enter Engineering Pte. Ltd.*
Город: *Ташкент, Узбекистан*
Вакансия: *Аналитик данных / Middle Data Analyst*
Вилка: *$ 1500-2200 net*

Формальное описание вакансии: <https://hh.ru/vacancy/31771850>

*ENTER Engineering* – современная, динамично развивающаяся компания, которая специализируется на строительстве нефтегазовых объектов на территории Республики Узбекистан. Компания была основана в 2011 г. и за сравнительно короткое время успела стать одним из признанных лидеров на рынке объектов энергетического, нефтегазового и гражданского строительства. Вакансия предполагает релокацию в Республику Узбекистан.

*Условия:* оплата перелета, компенсация расходов на аренду жилья, бесплатное питание, оплата мобильной связи

Ищу к себе коллегу, который поможет развить новое для Компании направление. Первоочередной задачей является построение описательной аналитики. Далее в планах и предиктивная. Данных в Компании достаточно, с ними никто раньше серьезно не занимался.

*Чем предстоит заниматься:*
- сбором, очисткой и подготовкой данных из различных источников;
- разрабатывать и тестировать гипотезы;
- визуализировать данные;
- интерпретировать результаты и готовить аналитические отчеты;
- разрабатывать рекомендации;
- осуществлять контроль над внедрением рекомендаций;
- решать задачи построения моделей классификации, кластеризации, регрессии.
*Что ждем от кандидата:*
- отличное знание математической статистики, теории вероятностей;
- отличное владение Python (jupyter, pandas, numpy);
- навыки работы с базами данных (sql запросы);
- знание методов машинного обучения - желательно;
- высокие аналитические способности;
- хорошие коммуникативные навыки;
- грамотная устная и письменная речь.
Присылайте резюме по адресу: <mailto:danil.eremin@ent-en.com|danil.eremin@ent-en.com>
